import React, { useState } from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from './pages/Home';
import About from './pages/About';
import Post from './pages/Post';

function App() {
  return (
    <Router>
      <div>
        <header>
          <nav>
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/about">About</Link>
              </li>
            </ul>
          </nav>
        </header>

        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/post/:id" component={Post} />
          <Route path="/">
            <Home />
          </Route>
        </Switch>

        <footer>
          Copyright &copy; {new Date().getFullYear()} My Blog
        </footer>
      </div>
    </Router>
  );
}

export default App;
